import { Container, Row, Col } from "react-bootstrap";
import { Link } from "react-router-dom";
import "./NotFound.scss";

const NotFound = () => {
  return (
    <Container>
      <Row>

        </Row>

      <h1>Not Found</h1>
      <Link to="/">Go to Home Page</Link>
    </Container>
  );
};

export default NotFound;
